    string data;
    getline(cin, data);
    int count_open_tags = 0;
    int count_closing_tags = 0;
    for (int i = 1; i < data.size(); i++) {
        if (data[i - 1] == '<' && data[i] != '/')
            count_open_tags++;
        else if(data[i - 1] == '<' && data[i] == '/')
            count_closing_tags++;
    }
    CustomStack open_tags(count_open_tags);
    for (int i = 0; i < data.size(); i++) {
        char res[10];
        res[0] = '\0';
        if (data[i] == '<'){
            int j = i + 1, n = 0;
            while(data[j] != '>') {
                res[n] = data[j];
                n++; j++;
            }
            res[n] = '\0';
            if(res[0] == '/'){
                char *check = open_tags.top();
                for(int k = 1; res[k]; k++)
                    if(check[k - 1] != res[k]){
                        cout << "wrong";
                        return 0;
                    }
                open_tags.pop();
            }
            else if(strcmp(res, "br") != 0 && strcmp(res, "hr") != 0)
                open_tags.push(res);
            i = j;
        }
    }
    cout << "correct";
    return 0;
}

