const int INF = 1e9;
const ll LINF = 1e18;
const ll MOD = 1e9 + 7;
const int maxn = 2e5 + 3;
const int maxc = 1e5 + 1;



int n, m;
bitset<20001> dp;
 
void init() {

    cin >> n >> m;
    dp.reset();
    dp[0] = true;

}



void solve() {

    int ok = false;
    vector<pair<int, int> > C;
    for (int i = 0; i < n; i++) {
        int v, c; cin >> v >> c;
        C.emplace_back(make_pair(v, c));
    }

    for (auto& [v, c] : C) {
        for (int k = 1; k <= c; k <<= 1) {  // 2 進位拆解

            // bitset 優化 0/1 背包
            dp = dp | (dp << (v*k));
            c -= k;

            if (dp[m]) { ok = true; break; }
        }
        if (c) { dp = dp | (dp << (v*c)); }
        if (dp[m]) ok = true;
        if (ok) break;
    }

    cout << (ok ? "Yes" : "No") << endl;

}

